keypad = [
    (0, 0, 1, 0, 0),
    (0, 2, 3, 4, 0),
    (5, 6, 7, 8, 9),
    (0, 'A', 'B', 'C', 0),
    (0, 0, 'D', 0, 0)
]
current_key = (2, 0)
password = ""
code = ["",
        "",
        "",
        "",
        ""
        ]

for instruction in code:
    for step in instruction:
        if step == 'U':
            x = current_key[0] - 1 if current_key[0] - \
                1 >= 0 else current_key[0]
            y = current_key[1]
        elif step == 'D':
            x = current_key[0] + 1 if current_key[0] + \
                1 < 5 else current_key[0]
            y = current_key[1]
        elif step == 'L':
            x = current_key[0]
            y = current_key[1] - 1 if current_key[1] - \
                1 >= 0 else current_key[1]
        elif step == 'R':
            x = current_key[0]
            y = current_key[1] + 1 if current_key[1] + \
                1 < 5 else current_key[1]
        if keypad[x][y] != 0:
            current_key = (x, y)

    password += str(keypad[current_key[0]][current_key[1]])

print(password)
